////////////////////////////////////////
//////// API ACCESS TO SONGKICK.COM


import React, { Component } from 'react';
class Concerts extends Component {
    constructor(props){
        super(props);
        this.state = {
            upcomingConcerts: [],
        }
    }
    componentDidMount(){
        let temp = [];
        // https://api.songkick.com/api/3.0/artists/{artist_id}/calendar.json?apikey=4qVB9zk3XpWOwz8C
            fetch('https://api.songkick.com/api/3.0/search/artists.json?apikey=4qVB9zk3XpWOwz8C&query=radiohead')
            .then(res => res.json())//response type
            .then((data) => {
                temp = data;
            })
        setTimeout(() => {
            console.log(temp);
        }, 200);

    }
    render () {
        return <div>{this.props.artist}</div>
    }
}

export default Concerts;
